from unicorn.x86_const import *

# Initialize Keystone assembler
ks = Ks(KS_ARCH_X86, KS_MODE_64)

# Initialize Unicorn emulator
mu = Uc(UC_ARCH_X86, UC_MODE_64)
DATA_ADDRESS = 0x1000000
mu.mem_map(DATA_ADDRESS, 2 * 1024 * 1024)

# Initialize array of values
byte_array = bytearray()
for value in values:
    byte_array.extend(value.to_bytes(16, byteorder='little'))

