mu.mem_write(FLAG_ADDRESS, flag)

CODE_ADDRESS = FLAG_ADDRESS + 0x100

# Set the R14 register to the flag address
mu.reg_write(UC_X86_REG_R14, FLAG_ADDRESS)

def print_xmm():
    xmm0 = mu.reg_read(UC_X86_REG_XMM0)
    print("xmm0:", xmm0.to_bytes(16, byteorder='little').hex())
    
